import React from "react";
import Travel from "./Travel";

const travels_tab = [
    {
        destination:"Yangon",
        country:"Myanmar",
        photo:"https://cdn.pixabay.com/photo/2019/08/06/12/15/panama-4388225_960_720.jpg",
        distance:"2000"
    },
    {
        destination:"Kinahsa",
        country:"Congo",
        photo:"",
        distance:"8000"
    },
    {
        destination:"Bangkok",
        country:"Thailande",
        photo:"https://pixabay.com/fr/photos/paris-tour-eiffel-france-4353082/",
        distance:"533"
    },
    {
        destination:"Las-Vegas",
        country:"US",
        photo:"https://pixabay.com/fr/photos/allemagne-ch%C3%A2teau-l-architecture-4380763/",
        distance:"1000"
    },
    {
        destination:"Bruxelles",
        country:"Belgiques",
        photo:"https://pixabay.com/fr/photos/lisbonne-portugal-rouge-tram-4379656/",
        distance:"3000"
    } ];



const Travels =() => (
    <div>
        {travels_tab.map( arg => (
            <Travel destination={arg.destination} country={arg.country} photo={arg.photo} distance={arg.distance}/>
        )) }

    </div>
);
export default Travels;
